import React, { useState } from 'react'

function Counter() {
    const [car, setCar] = useState({
        brand: "Ford",
        model: "Mustang",
        year: "1964",
        color: "red"
    });

    return (
        <>
            <p>
                {JSON.stringify(car)}
            </p>
            <button onClick={()=>(setCar((prev)=>{
            return {...prev,color:"greenS"}
        }))}>change color</button>
        </>
    )
}

export default Counter
